import React from "react";

export default function Synonyms(props) {
  console.log("Synonyms prop:", props.synonyms);
  console.log("Type:", typeof props.synonyms);
  console.log("Is array:", Array.isArray(props.synonyms));

  if (props.synonyms && props.synonyms.length > 0) {
    return (
      <ul className="Synonyms">
        {props.synonyms.map(function (synonym, index) {
          return (
            <li key={index}>
              <em>{synonym}</em>
            </li>
          );
        })}
      </ul>
    );
  } else {
    return null;
  }
}
